SELECT
	DAY AS CREATE_TIME,
	round(MIN_USEREX_UPAVGRATE, 2) AS MIN_USEREX_UPAVGRATE,
	round(MIN_USEREX_DWAVGRATE, 2) AS MIN_USEREX_DWAVGRATE
FROM
	FRT_AGPS_PC_ENB_D
WHERE
	DAY BETWEEN #{STARTDAY}
AND #{ENDDAY}
AND ENODEB_ID = #{ENODEBID}
AND CELL_ID = #{CELLID}
ORDER BY
	DAY ASC
